import Tabletop from 'tabletop';

const Company = () => {
    const [info, setInfo] = useState([])

    const getSpredSheet = async() => {
        const res = Tabletop.init({
            key: '1iQhGbFVfEGXLVzrsbxKi-SwVsXkDWI_XyrrFok8rTdk',
            callback: googleData => {
              console.log('google sheet data --->', googleData)
            },
        });
        return res.data
    }


    return (
        <div>
            {info.シート1.elements.map((company => {
                <div>{company.企業名}</div>
            }))}
        </div>
    )
}

export default Company
